    void Change(DateTime? value, string name, string format)
    {
        events.Add(DateTime.Now, $"{name} value changed to {value?.ToString(format)}");
        StateHasChanged();
    }


    // close popup
    void ClosePopup()
    {
        // Close the Popup
        ShowPopup = false;
